  false,\n\t\"url\": null,\n\t\"notes\": \"Himalayan Blackberry has become a substantial
  threat to large expanses of open oak savanna habitat on Finley NWR. While mowing
  and burning help to keep it at bay, these control methods rarely kill the plant.
  Carefully timed herbicide application combined with mowing and burning has been
  found to kill the plant, returning the habitat to primarily herbaceous. Out of the
  775 of acres that contain blackberry, approximately 320 acres were treated in 2014.
  This proposal would fund a spring follow-up on previously treated acres as well
  as add up to 350 new acres to the list of treated areas. Meadow knapweed would also
  be added as a target while covering upland areas for blackberry. Native seed will
  be distributed in heavily infested areas to discourage establishment of other weeds
  in disturbed areas.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
